import './App.css';
import Home from './Home/Home';
import Index from './Infor/Index';
import YourCart from './YourCart/YourCart';
import { Routes, Route } from "react-router-dom";
import Login from './Accout/Login';
import Allsp from './AllSp/Allsp';
import SearchCpn from "./Search/Search";


function App() {


  return (
    <Routes>
      <Route path="/" element={<Home />} />
      <Route path="/infor/:id" element={<Index />} />
      <Route path="/accout" element={<Login />} />
      <Route path="/cart" element={<YourCart />} />
      <Route path="/allsp/:type" element={<Allsp />} />
      <Route path="/search" element={<SearchCpn />} />
    </Routes>

  )
}

export default App;
